import React from 'react';
import { Link, Routes, Route } from 'react-router-dom';
import {EditUser} from './EditUser';
import User from './User';
// import './style.css';
import { TABS, TAB_IDS } from './Reducer';
import { AddUser } from './AddUser';
import Logout from './Logout';
import { Login } from './login';
// import UserForm from './UserForm';
// import NotFound from '../../components/NotFound';
// import {Login} from "./login"


export const Community = () => {
    return (
        <>
          <nav className="navbar navbar-expand-lg navbar-light bg-light fixed-top">
            <div className="container">
              <Link className="navbar-brand" to="/films">
               MovieZilla
              </Link>
    
              <button
                className="navbar-toggler"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#navbarSupportedContent"
                aria-controls="navbarSupportedContent"
                aria-expanded="false"
                aria-label="Toggle navigation"
              >
                <span className="navbar-toggler-icon"></span>
              </button>
    
              <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <div className="navbar-nav me-auto mb-2 mb-lg-0">
                  {TABS.map(({ id, text }, index) => (
                    <Link key={index} className="nav-link" to={`/${id}`}>
                      {text}
                    </Link>
                  ))}
                </div>
              </div>
            </div>
          </nav>
    
          <div className="container mt-5">
            <Routes>
              <Route path={`/${TAB_IDS.FILMS}`} element={<Films />} />
              <Route path={`/${TAB_IDS.PEOPLE}`} element={<People />} />
              <Route path={`/${TAB_IDS.PLANETS}`} element={<Planets />} />
              <Route path={`/${TAB_IDS.SPECIES}`} element={<Species />} />
              <Route path={`/${TAB_IDS.STARSHIPS}`} element={<Starship />} />
              <Route path={`/${TAB_IDS.VEHICLES}`} element={<Vehicles />} />
            </Routes>
          </div>
        </>
      );
    }
